import PropTypes from 'prop-types';
import { Link as RouterLink } from 'react-router-dom';
// material
import { Box } from '@mui/material';

// ----------------------------------------------------------------------

Logo.propTypes = {
  sx: PropTypes.object
};

export default function Logo({ sx }) {
  return (
    <RouterLink to="/">
      <Box component="img" src="https://www.clipartmax.com/png/middle/114-1148415_keyboard-icon.png" sx={{ width: 40, height: 40, ...sx }} />
    </RouterLink>
  );
}
